import badboy from '../src/img/badboy3.jpg';
import frozen from '../src/img/frozen.jpg';
import jumanji from '../src/img/jumanji.jpg';
import maleficient from '../src/img/maleficent.jpg';
import onceupon from '../src/img/once_upon.jpg';
import starwars from '../src/img/starwars.jpg';
import terminator from '../src/img/terminator.jpg';





function App() {
  var movieData = [  {like: true,
                      Vues: 7,
                      Avis: 3,
                      Moyenne: 6,
                      Nom: "BadBoy",
                      img: badboy},
                      { like: false,
                        Vues: 7,
                        Avis: 3,
                        Moyenne: 6,
                        Nom: "Jumanji",
                        img: jumanji},
                        { like: false,
                          Vues: 7,
                          Avis: 3,
                          Moyenne: 6,
                          Nom: "Frozen",
                          img: frozen},
                          { like: true,
                            Vues: 7,
                            Avis: 3,
                            Moyenne: 6,
                            Nom: "Star Wars",
                            img: starwars},
                            { like: true,
                              Vues: 7,
                              Avis: 3,
                              Moyenne: 6,
                              Nom: "Malefique",
                              img: maleficent},];



  var movieList = movieData.map((oneMovie, i) => {
    console.log("bool", oneMovie);
    return(<Movie booleanLike = {oneMovie.like} nbreVue = {oneMovie.Vues} nivAvis = {oneMovie.Avis} nivMoyenne = {oneMovie.Moyenne} nameMovie = {oneMovie.Nom}/>);


  });

return (
    <Container className= "App">
       <Row>
        <Col>
        <Nav>
        <NavItem>
          <NavLink >< img src="../img/logo.png" /></NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">Link</NavLink>
        </NavItem>
        <NavItem>
          <NavLink href="#">Another Link</NavLink>
        </NavItem>
        </Nav>
        </Col>
      </Row>
      <Row>
          {movieList}

      </Row>

      </Container>
  );
};

export default App;
